import{_ as e,J as t,e as a,f as i,N as o,a5 as n,a6 as r,s,j as l,V as u}from"./chunks/framework.723ed59e.js";const c=JSON.parse('{"title":"[Automatic Tracking] Troubleshooting","titleTemplate":":title | Kongying Tavern","description":"Troubleshoot","frontmatter":{"aside":true,"titleTemplate":":title | Kongying Tavern","prev":{"text":"[Automatic Tracking] Important Notes","link":"../auto-tracking/importantnotes"},"next":{"text":"[Background Usage] Framerate/Tracking Control","link":"../bg/bgfrate"},"description":"Troubleshoot"},"headers":[],"relativePath":"en/manual/guide/auto-tracking/troubleshoot.md","filePath":"en/manual/guide/auto-tracking/troubleshoot.md","lastUpdated":1688797282000}'),g={name:"en/manual/guide/auto-tracking/troubleshoot.md"},h=s("h1",{id:"automatic-tracking-troubleshooting",tabindex:"-1"},[l("[Automatic Tracking] Troubleshooting "),s("a",{class:"header-anchor",href:"#automatic-tracking-troubleshooting","aria-label":'Permalink to "[Automatic Tracking] Troubleshooting"'},"​")],-1),d=s("h2",{id:"issue1",tabindex:"-1"},[l("1. When auto tracking is engaged, the in-game minimap does not show pins, nor is there an overlay of the map client "),s("a",{class:"header-anchor",href:"#issue1","aria-label":'Permalink to "1. When auto tracking is engaged, the in-game minimap does not show pins, nor is there an overlay of the map client {#issue1}"'},"​")],-1),m=s("p",null,"The auto tracking feature cannot overlay the game window, you can use the Stay on Top feature to have a similar effect as the title describes.",-1),p=s("p",null,"Showcase：",-1),f=u('<h2 id="issue2" tabindex="-1">2. Cannot download auto tracking module, the download window flashes or the download speed is 0.00 kb/s <a class="header-anchor" href="#issue2" aria-label="Permalink to &quot;2. Cannot download auto tracking module, the download window flashes or the download speed is 0.00 kb/s {#issue2}&quot;">​</a></h2><p>There is a problem with our server, join our <a href="https://discord.gg/S7MxgjcbtD" target="_blank" rel="noreferrer">Discord</a> and download the module there. Once the installation finishes, restart the map client to load the module.</p><h2 id="issue3" tabindex="-1">3. Receiving C++ Runtime error or client crashing after enabling auto tracking <a class="header-anchor" href="#issue3" aria-label="Permalink to &quot;3. Receiving C++ Runtime error or client crashing after enabling auto tracking {#issue3}&quot;">​</a></h2><ul><li>Simply re-enable auto tracking</li><li>Clear the auto tracking cache, launch the map client again and enable auto tracking, you will need to wait for the cache to build again</li></ul><figure><img src="/docs/imgs/en/manual/auto-tracking/6.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li>Please reach out in <a href="https://discord.gg/8wgttNDwse" target="_blank" rel="noreferrer">#feedback on Discord</a> if the issue remains, include &quot;【启动自动追踪模块后软件崩溃】&quot; in your message.</li></ul><h2 id="issue4" tabindex="-1">4. Nothing happens when auto tracking is engaged <a class="header-anchor" href="#issue4" aria-label="Permalink to &quot;4. Nothing happens when auto tracking is engaged {#issue4}&quot;">​</a></h2><ul><li>When using a new version for the first time, the module requires 1-5 minutes to rebuild its cache. During this process, switching versions or using the tracking screenshot function may cause the client to stop responding. If no player indicator shows up after 10 minutes, or if it is not the initial activation of a new version, please refer to issues further down the list.</li><li>Double-check if the auto tracker is toggled on.</li><li>Check the in-game minimap for obstructions, and ensure that it&#39;s displaying properly.</li><li>Check the &quot;DLL&quot; version at the lower left corner of the map client. If it shows &quot;Uninitialized&quot;, try restarting auto tracking.</li></ul><p><img src="/docs/imgs/en/manual/auto-tracking/3.png" alt="" loading="lazy"><img src="/docs/imgs/en/manual/auto-tracking/4.png" alt="" loading="lazy"><img src="/docs/imgs/en/manual/auto-tracking/5.png" alt="" loading="lazy"></p><p>If the problem persists, use [Clear Tracking Module] under the auto tracking settings tab, which deletes all files in <code>%APPDATA%\\..\\LocalLow\\空荧酒馆\\Map\\DLL</code>, and download the tracking module again.</p><figure><img src="/docs/imgs/en/manual/auto-tracking/1.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li>Use &quot;Obtain Tracking Screenshot&quot; in the auto tracking settings, if the screenshot is blank, showing a non-current image of the game, or unsuccessful, please see Issue 5.</li><li>If a normal screenshot is obtained, but no player indicator shows up, please see Issue 6.</li></ul><h2 id="issue5" tabindex="-1">5. Screenshot errors (Blank or non-current game image) <a class="header-anchor" href="#issue5" aria-label="Permalink to &quot;5. Screenshot errors (Blank or non-current game image) {#issue5}&quot;">​</a></h2><p><span style="color:red;">Some Windows 11 machines may not support BitBlt properly, switching the Tracking Mode to DirectX will likely solve the issue.</span></p><ul><li>Try switching Tracking Modes (The modes differ only in capture method, there is no effect on tracking accuracy) <ul><li>BitBlt supports both windowed and exclusive fullscreen game</li><li>DirectX supports windowed game only</li></ul></li><li>Try running the game windowed (<strong>Alt+Enter</strong>, game does not minimize when pressing <strong>Win</strong> key). If you want to play the game fullscreen, please refer to: <a href="./../overlay-mode/fullscreen-windowed/launching">Launching The Game in Windowed Fullscreen (Borderless)</a></li><li>To use BitBlt in Windows 11, go to the Graphics settings (Settings-&gt;System-&gt;Display-&gt;Graphics), add GenshinImpact.exe to the list (<code>***\\Genshin Impact Game\\GenshinImpact.exe</code>, not launcher.exe) and <strong>enable</strong> &quot;Don&#39;t use optimizations for windowed games&quot;.</li></ul><figure><img src="/docs/imgs/en/manual/auto-tracking/windowedoptimization.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li>Please message in <a href="https://discord.gg/8wgttNDwse" target="_blank" rel="noreferrer">#feedback on Discord</a> if the issue remains, include &quot;【自动追踪截图失败】&quot; in your message.</li></ul><h2 id="issue6" tabindex="-1">6. The screenshot is normal, but the player indicator is not displayed or does not move <a class="header-anchor" href="#issue6" aria-label="Permalink to &quot;6. The screenshot is normal, but the player indicator is not displayed or does not move {#issue6}&quot;">​</a></h2><ul><li>Please try with a resolution greater than 720p.</li><li>Auto HDR, some color calibration profiles, Game Filters, &quot;eye savers&quot;, etc. can reduce tracking accuracy or prevent the auto tracker from working.</li><li>Auto tracking may not work properly with an aspect ratio greater than 21:9, switch to a 16:9 resolution and restart the game, if tracking functions properly in 16:9 only, reach out in <a href="https://discord.gg/8wgttNDwse" target="_blank" rel="noreferrer">#feedback on Discord</a> with a message including &quot;【带鱼屏适配有问题】&quot;.</li><li>Please reach out in <a href="https://discord.gg/8wgttNDwse" target="_blank" rel="noreferrer">#feedback on Discord</a> if the issue remains, include &quot;【自动追踪截图正常但无法追踪】&quot; in your message.</li></ul><h2 id="issue7" tabindex="-1">7. Drifting player indicator <a class="header-anchor" href="#issue7" aria-label="Permalink to &quot;7. Drifting player indicator {#issue7}&quot;">​</a></h2><p>When the player indicator is at the wrong location, but moves with your in-game movement, clear the auto tracking cache from the settings and restart auto tracking to rebuild it. (see <a href="#_3-receiving-c-runtime-error-or-client-crashing-after-enabling-auto-tracking"><strong><em>Issue 3.</em></strong></a>)</p><h2 id="issue8" tabindex="-1">8. Player indicator teleports or updates player movement slowly <a class="header-anchor" href="#issue8" aria-label="Permalink to &quot;8. Player indicator teleports or updates player movement slowly {#issue8}&quot;">​</a></h2><p>Occasional teleportation skips of the player indicator cannot be avoided due to the nature of our image recognition algorithm, but you can reduce its occurrence and improve responsiveness with the following actions:</p><ul><li>Set the in-game minimap to &quot;Fixed&quot; (required)</li><li>Use a game resolution greater than 720p</li><li>Improve tracking accuracy by enabling anti-aliasing</li><li>Reducing tracking interval when it does not impact performance too much</li><li>Standing still for 3-10 seconds will allow the auto tracker to recapture your location</li><li>If the player indicator continues to skip around, teleport to a waypoint, if the tracking returns to normal, the previous location does not have enough features for the tracker to recognize. (e.g. on the sea, open desert, sand storms, masked and yet-to-unlock areas)</li></ul><hr><ul><li>Too many <strong>in-game custom pins</strong> will significantly reduce tracking accuracy. (e.g. Quest navigation, vendors, custom pins, etc.)</li><li>Some areas can change appearance through world quest progression, auto tracking compares the game image to the <strong>final form</strong> of the map. For auto tracking to work accurately, please complete the related world quests. You can view the final form of the map in the map client. Areas that change:</li></ul><table><thead><tr><th>Khaj-Nisut</th><th>Safhe Shatranj</th><th>Dunes of Steel</th></tr></thead><tbody><tr><td><strong>The Sands of Three Canals</strong></td><td><strong>Wounded Shin Valley</strong></td><td><strong>Tunigi Hollow</strong></td></tr></tbody></table><ul><li>If teleportation persists, please reach out in <a href="https://discord.gg/8wgttNDwse" target="_blank" rel="noreferrer">#feedback on Discord</a>, include &quot;【全局追踪无法定位到正确的位置】&quot; in your message.</li></ul>',28);const k=e(g,[["render",function(e,s,l,u,c,g){const k=t("VPCard");return a(),i("div",null,[h,d,m,p,o(k,n(r({title:"The Best Underground Map (Kongying Tavern x Teyvat Map Institute)",link:"https://www.reddit.com/r/Genshin_Impact/comments/12znlyd/the_best_underground_map_kongying_tavern_x_teyvat/",theme:"medium"})),null,16),f])}]]);export{c as __pageData,k as default};
